import React from 'react'

export const ScoreTable = ({ data }) => {
    return(
        <table>
            <th>Id</th>
            <th>Task name</th>
            <th>Start time</th>
            <th>Stop time</th>
            <th>Duration</th>
            {data.map(elem)}
        </table>
    )
}
